{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/melissachan1/bellabeat-case-study-with-r?scriptVersionId=194616565\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"a4a7e7f2","metadata":{"papermill":{"duration":0.018615,"end_time":"2024-08-29T22:38:05.908705","exception":false,"start_time":"2024-08-29T22:38:05.89009","status":"completed"},"tags":[]},"source":["![](https://bellabeat.com/wp-content/uploads/2023/09/Bellabeat-logo.jpg)\n"]},{"cell_type":"markdown","id":"7e951c22","metadata":{"papermill":{"duration":0.017318,"end_time":"2024-08-29T22:38:05.944102","exception":false,"start_time":"2024-08-29T22:38:05.926784","status":"completed"},"tags":[]},"source":["# Summary\n","\n","## About The Company\n","\n","Bellabeat, a high-tech company founded by Urška Sršen and Sando Mur that manufactures health-focused smart products, including the Bellabeat App.  What sets Bellabeat apart is its focus on empowering women globally by collecting and analyzing consumer data related to activity, sleep, stress, and reproductive health. This data-driven approach provides women with valuable insights into their health and habits.\n","\n","Urška Sršen, the co-founder and Chief Creative Officer, believes that analyzing smart device fitness data can offer deeper insights into how consumers interact with their devices. These insights could uncover new growth opportunities and inform strategic improvements in Bellabeat's marketing efforts.\n","\n","# Ask\n","\n","## Business Task\n","\n","Analyze smart device fitness data to identify growth opportunities and provide strategic recommendations to enhance Bellabeat's marketing strategy.\n","\n","# Data Source\n","\n","### Smart Device Fitness Data\n","\n","For this study, I will use the [FitBit Fitness Tracker Data](https://www.kaggle.com/datasets/arashnic/fitbit/data) conducted by Kaggle user Arashnic.\n","\n","This dataset is particularly interesting to me as a Healthcare Analyst because the creator's inspiration was \"Human temporal routine behavioral analysis and pattern recognition\", which is a topic I am highly fascinated by.\n","\n","## Dataset Content\n","\n","The FitBit Fitness Tracker data set is generated by thirty eligible Fitbit users who consented to participating in a survey between March 12, 2016 to May 12, 2016 via Amazon Mechanical Turk. Participants included the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring.\n","\n","The original data set creator mentions that \"Variation between output represents use of different types of Fitbit trackers and individual tracking behaviors/preferences.\"\n","\n","# Ask\n","\n","## Questions for Analysis\n","\n","**1. What are some trends in smart device usage?**\n","**2. How could these trends apply to Bellabeat customers?**\n","**3. How could these trends help influence Bellabeat marketing strategy?**"]},{"cell_type":"markdown","id":"dbf45517","metadata":{"papermill":{"duration":0.017702,"end_time":"2024-08-29T22:38:05.979007","exception":false,"start_time":"2024-08-29T22:38:05.961305","status":"completed"},"tags":[]},"source":[]},{"cell_type":"markdown","id":"8d4ea8f8","metadata":{"papermill":{"duration":0.018119,"end_time":"2024-08-29T22:38:06.013838","exception":false,"start_time":"2024-08-29T22:38:05.995719","status":"completed"},"tags":[]},"source":["# Prepare\n","\n","## Load Packages"]},{"cell_type":"code","execution_count":1,"id":"61857440","metadata":{"execution":{"iopub.execute_input":"2024-08-29T22:38:06.055142Z","iopub.status.busy":"2024-08-29T22:38:06.052763Z","iopub.status.idle":"2024-08-29T22:38:07.709012Z","shell.execute_reply":"2024-08-29T22:38:07.706603Z"},"papermill":{"duration":1.680773,"end_time":"2024-08-29T22:38:07.712671","exception":false,"start_time":"2024-08-29T22:38:06.0318