teps daily.\n","* 24 participants (73.7%) tracked their sleep.\n","* 14 participants (42.4%) tracked their heartrate.\n","* 8 participants (24.2%) tracked their weight.\n","\n","**Summary of Analysis:**\n","\n","All 33 participants used their FitBit Tracker to track their daily activity, calories, intensities, and steps while on the other hand, only 8 out of 33 participants tracked their weight.\n","\n","**Insights for Bellabeat**\n","\n","* Consider enhancing the tracking capabilities of new products and improve Bellabeat's user experience by prioritizing the most frequently tracked categories.\n","\n","* Could develop a new product that addresses gaps in the market by focusing on the less commonly tracked data categories, making them significantly better than those offered by FitBit or other competitors."]},{"cell_type":"markdown","id":"28dc191c","metadata":{"papermill":{"duration":0.027855,"end_time":"2024-08-29T22:38:22.564856","exception":false,"start_time":"2024-08-29T22:38:22.537001","status":"completed"},"tags":[]},"source":["## Q: What is the relationship between steps taken in day and calories?\n","\n","**Hypothesis:** The relationship between steps taken in a day (totalsteps) and calories (calories) should be a positive correlation. More steps taken in a day should result in a higher amount of calories burned."]},{"cell_type":"code","execution_count":18,"id":"38822def","metadata":{"execution":{"iopub.execute_input":"2024-08-29T22:38:22.70015Z","iopub.status.busy":"2024-08-29T22:38:22.698475Z","iopub.status.idle":"2024-08-29T22:38:24.379151Z","shell.execute_reply":"2024-08-29T22:38:24.376987Z"},"papermill":{"duration":1.790548,"end_time":"2024-08-29T22:38:24.383828","exception":false,"start_time":"2024-08-29T22:38:22.59328","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`geom_smooth()` using method = 'loess' and formula = 'y ~ x'\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIA