dations for calculating the amount of time users should spend being active to achieve their calorie-burning goals."]},{"cell_type":"markdown","id":"8c950a81","metadata":{"papermill":{"duration":0.032204,"end_time":"2024-08-29T22:38:24.510028","exception":false,"start_time":"2024-08-29T22:38:24.477824","status":"completed"},"tags":[]},"source":["## Q: What is the relationship between total time in bed and the total time asleep?\n","\n","**Hypothesis:** There should be a positive correlation between total time in bed (totaltimeinbed) and total time asleep (totalminutesasleep). The more time spent in bed, the more time we tend to sleep.\n","\n","* I will calculate the average number of hours each participant spends: asleep, sedentary, lightly active, fairly active, and very active.\n","* Set hours asleep as the constant, and use the different activity levels as the variables.\n","* Use these variables to plot the graph and demonstrate the results using faceted plots."]},{"cell_type":"code","execution_count":19,"id":"ce00d377","metadata":{"execution":{"iopub.execute_input":"2024-08-29T22:38:24.578103Z","iopub.status.busy":"2024-08-29T22:38:24.576234Z","iopub.status.idle":"2024-08-29T22:38:24.59807Z","shell.execute_reply":"2024-08-29T22:38:24.596085Z"},"papermill":{"duration":0.058742,"end_time":"2024-08-29T22:38:24.601281","exception":false,"start_time":"2024-08-29T22:38:24.542539","status":"completed"},"tags":[]},"outputs":[],"source":["#sleep hours\n","  sleep_hours <- mutate(sleep, totalhoursasleep=totalminutesasleep/60) %>% \n","  mutate(totalhoursinbed=totaltimeinbed/60) %>% \n","  select(id, date, totalhoursasleep, totalhoursinbed)"]},{"cell_type":"code","execution_count":20,"id":"02c2626e","metadata":{"execution":{"iopub.execute_input":"2024-08-29T22:38:24.668836Z","iopub.status.busy":"2024-08-29T22:38:24.667032Z","iopub.status.idle":"2024-08-29T22:38:25.226516Z","shell.execute_reply":"2024-08-29T22:38:25.224431Z"},"papermill":{"duration":0.596552,"end_time":"202