ly activities impact sleep, compare the total time asleep against sedentary, lightly active, fairly active, and very active time.\n","* Merge the two data frames to facilitate easier comparability.\n","* Use colnames() to view all column names, ensuring that only the necessary columns are selected for analysis.\n","* Use drop_na() to exclude NULL values."]},{"cell_type":"code","execution_count":21,"id":"87fcb545","metadata":{"execution":{"iopub.execute_input":"2024-08-29T22:38:25.431227Z","iopub.status.busy":"2024-08-29T22:38:25.429475Z","iopub.status.idle":"2024-08-29T22:38:25.45496Z","shell.execute_reply":"2024-08-29T22:38:25.453031Z"},"papermill":{"duration":0.063115,"end_time":"2024-08-29T22:38:25.457739","exception":false,"start_time":"2024-08-29T22:38:25.394624","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<style>\n",".list-inline {list-style: none; margin:0; padding: 0}\n",".list-inline>li {display: inline-block}\n",".list-inline>li:not(:last-child)::after {content: \"\\00b7\"; padding: 0 .5ex}\n","</style>\n","<ol class=list-inline><li>'id'</li><li>'date'</li><li>'sedentaryminutes'</li><li>'lightlyactiveminutes'</li><li>'fairlyactiveminutes'</li><li>'veryactiveminutes'</li><li>'sedentaryactivedistance'</li><li>'lightactivedistance'</li><li>'moderatelyactivedistance'</li><li>'veryactivedistance'</li><li>'totalactiveminutes'</li></ol>\n"],"text/latex":["\\begin{enumerate*}\n","\\item 'id'\n","\\item 'date'\n","\\item 'sedentaryminutes'\n","\\item 'lightlyactiveminutes'\n","\\item 'fairlyactiveminutes'\n","\\item 'veryactiveminutes'\n","\\item 'sedentaryactivedistance'\n","\\item 'lightactivedistance'\n","\\item 'moderatelyactivedistance'\n","\\item 'veryactivedistance'\n","\\item 'totalactiveminutes'\n","\\end{enumerate*}\n"],"text/markdown":["1. 'id'\n","2. 'date'\n","3. 'sedentaryminutes'\n","4. 'lightlyactiveminutes'\n","5. 'fairlyactiveminutes'\n","6. 'veryactiveminutes'\n","7. 'sedentaryactivedistance'\n","8. 'lightactivedistance'\n"