\"), method=\"lm\", se=FALSE) +\n","\n","# veryactive vs asleep\n","  geom_point(aes(y=mean_veryactive, color=\"Very Active\")) +\n","  geom_smooth(aes(y=mean_veryactive, color=\"Very Active\"), method=\"lm\", se=FALSE) +\n"," \n","# labels and annotations  \n","  xlab(\"Average Hours Asleep\") +\n","  ylab(\"Average Hours Active\") +\n","  labs(title=\"Average Hours Active VS Asleep\",\n","       subtitle=\"How do different activity intensities impact our sleep?\", \n","       caption=\"This plot demonstrates the impact of activity intensities on sleep. Data collected from 24 participants.\", \n","       color=\"Activity Intensity\") +\n","  \n","# fix x and y axes scale  \n","  scale_x_continuous(limits=c(0,9),\n","                     breaks=seq(0,9,5)) +\n","  scale_y_continuous(limits=c(0,20),\n","                     breaks=seq(0,20,5)) +\n","# change plot title size\n","  theme(plot.title=element_text(size=20)) "]},{"cell_type":"markdown","id":"debbb1f7","metadata":{"papermill":{"duration":0.036345,"end_time":"2024-08-29T22:38:27.557859","exception":false,"start_time":"2024-08-29T22:38:27.521514","status":"completed"},"tags":[]},"source":["**Summary of Analysis:**\n","\n","The trend for the other activity intensities is not as visually distinct as the Sedentary plot. Additionally, the Fairly Active and Very Active plots are difficult to differentiate because the lines overlap.\n","\n","Fortunately, this can be addressed by plotting each activity intensity separately and then patching them back together for comparison."]},{"cell_type":"markdown","id":"760f5dda","metadata":{"papermill":{"duration":0.036707,"end_time":"2024-08-29T22:38:27.630643","exception":false,"start_time":"2024-08-29T22:38:27.593936","status":"completed"},"tags":[]},"source":["#### Intensities vs Sleep (Individual Plots)"]},{"cell_type":"code","execution_count":27,"id":"98ec4e31","metadata":{"execution":{"iopub.execute_input":"2024-08-29T22:38:27.709613Z","iopub.status.busy":"2024-08-29T22: