                    breaks=seq(0,9,3)) +\n","  scale_y_continuous(limits=c(2,6),\n","                     breaks=seq(2,6,1)) + \n","  theme(plot.title=element_text(color=\"darkorange\"))\n","\n","fairlyactive_plot <- ggplot(data=average_intensities_sleep, aes(x=mean_asleep)) +\n","  geom_point(aes(y=mean_fairlyactive), color=\"turquoise\") +\n","  geom_smooth(aes(y=mean_fairlyactive), color=\"turquoise\", method=\"lm\", se=FALSE) +\n","  xlab(\"Hours Asleep\") +\n","  ylab(\"Fairly Active Hours\") +\n","  labs(title=\"Avg Hours Fairly Active vs Asleep\") +\n","  scale_x_continuous(limits=c(0,9),\n","                     breaks=seq(0,9,3)) +\n","  scale_y_continuous(limits=c(0,1.25),\n","                     breaks=seq(0,1.25,0.5)) +\n","  theme(plot.title=element_text(color=\"blue\"))\n","\n","\n","veryactive_plot <- ggplot(data=average_intensities_sleep, aes(x=mean_asleep)) +\n","  geom_point(aes(y=mean_veryactive), color=\"darkgreen\") +\n","  geom_smooth(aes(y=mean_veryactive), color=\"darkgreen\", method=\"lm\", se=FALSE) +\n","  xlab(\"Hours Asleep\") +\n","  ylab(\"Very Active Hours\") +\n","  labs(title=\"Avg Hours Very Active vs Asleep\") +\n","  scale_x_continuous(limits=c(0,9),\n","                     breaks=seq(0,9,3)) +\n","  scale_y_continuous(limits=c(0,2),\n","                     breaks=seq(0,2,0.5)) + \n","  theme(plot.title=element_text(color=\"darkgreen\"))\n","\n","# Combining all the plots using 'patchwork'. \n","(sedentary_plot | veryactive_plot) / (lightlyactive_plot | fairlyactive_plot) "]},{"cell_type":"markdown","id":"765f9acd","metadata":{"papermill":{"duration":0.039549,"end_time":"2024-08-29T22:38:29.342189","exception":false,"start_time":"2024-08-29T22:38:29.30264","status":"completed"},"tags":[]},"source":["**Summary of Analysis:**\n","\n","**Sedentary Hours vs. Hours Asleep:** \n","* Demonstrates a *negative correlation*. The more time participants spent sedentary, the less time they slept. Conversely, the less time participants were sedentary, the more they slept.\n","\n","**Very Active Hours vs. Hours Asleep:**\n","* Demonstrates a *positive correlation*. The more time participants spent being very active, the more they slept. The less time participants were very active, the less they slept.\n","\n","**Lightly Active Hours vs. Hours Asleep:**\n","* Although the results are scattered with no apparent correlation, the plot shows a **small negative correlation**.\n","\n","**Fairly Active Hours vs. Hours Asleep:**\n","* While the results are also scattered with no clear correlation, the plot suggests a **small positive correlation**.\n","\n","The results of our plots demonstrate that the intensities of daily activities **can** impact sleep. Participants experienced improved sleep with higher-intensity activities, while sedentary behavior negatively affected sleep quality. This suggests that incorporating high-intensity activities into daily routines is recommended for more restful sleep.\n","\n","For light and fairly active intensity activities, the plots show very little correlation with sleep. To draw more meaningful conclusions from these variables, a more extensive study would be necessary. \n","\n","\n","\n","**Insights for Bellabeat**\n","\n","* Personalized Activity Recommendations: Introduce an AI-driven feature that analyzes users' activity and sleep data to offer personalized recommendations. For example, if a user has been mostly sedentary, the app could suggest specific high-intensity activities tailored to their preferences, with a reminder on how these activities can improve sleep quality.\n","\n","* Stress-Reduction Techniques: Incorporate guided stress-reduction techniques, like breathing exercises or meditation, especially for users who engage in sedentary activities. These techniques could help improve sleep quality by addressing stress, which might be linked to both sedentary behavior and poor sleep.\n","\n"]},{"cell_type":"markdown","id":"2bc09508","metadata":{"papermill":{"duration":0.038948,"end_time":"2024-08-29T22:38:29.419983","exception":false,"start_time":"2024-08-29T22:38:29.381035","status":"completed"},"tags":[]},"source":["# Act\n","\n","## Marketing Strategies – Summary of Recommendations\n","\n","I have summarized the key findings and recommendations from my analysis to provide some high-level insights to inform Bellabeat’s marketing strategy. \n","\n","\n","**1. Encourage Comprehensive Tracking**\n","\n","Since only a small portion of participants tracked their weight in the FitBit study, Bellabeat could use this as leverage to encourage more comprehensive tracking by highlighting the benefits of monitoring various women-specific health metrics, such as:\n","\n","* **Body Composition Analysis** – Body fat percentage, muscle mass, bone density, and/or water retention.\n","* **Calorie Intake and Expenditure** – Calorie intake, micro-nutrient intake, and/or macro-nutrient distribution.\n","* **Menstrual Health** – Menstrual cycle tracking, symptoms, and patterns.\n","* **Hormonal Health** – Hormonal fluctuations, menstrual cycle phases, symptoms related to hormonal changes.\n","* **Behavioral and Emotional Factors** – Mood tracking, emotional eating patterns, triggers for unhealthy eating habits.\n","* **Stress and Recovery** – Stress levels, recovery times, heart rate variability (HRV).\n","* **Sleep Quality and Duration** – Sleep stages (light, deep, REM) and/or sleep disturbances in relation to the menstrual cycle.\n","* **Meal Composition** – Meal/nutrition planning in relation to women’s health.\n","* **Nutritional Guidance and Personalized Plans** – Personalized diet and exercise plans for various ages and stages of the menstrual cycle, progress reports, and/or professional guidance from nutritionists or personal trainers.\n","\n","By utilizing these comprehensive tracking methods, Bellabeat users can gain a deeper understanding of the various factors that influence their weight management progress and make more informed decisions to achieve their health goals in relation to their reproductive health.\n","\n","\n","**2. Calorie Burn Correlation with Steps**\n","\n","* Use the positive linear correlation between steps taken in a day and calories burned as a key message in the marketing strategy to attract fitness enthusiasts who are keen on tracking their calorie expenditure.\n","* Create activity campaigns around step challenges that encourage users to meet daily step goals to maximize calorie burn and encourage a healthier lifestyle.\n","\n","\n","**3. Promote Link Between High-Intensity Activities and Better Sleep**\n","\n","* Develop content that educates users about the benefits of incorporating high-intensity activities into their daily routines for better sleep quality.\n","* Introduce features or integrations that suggest high-intensity activities based on users' current activity levels, sleep patterns, and menstrual/hormonal cycle.\n","* Consider implementing smart alerts that could notify users when they need to increase their activity levels to help achieve their calorie-burning goals and improve sleep quality.\n","\n","\n","**4. Personalized Activity Recommendations**\n","\n","* Introduce an AI-driven feature that analyzes users' activity and sleep data to offer personalized recommendations. For example, if a user has been mostly sedentary, the app could suggest specific high-intensity activities tailored to their preferences, with reminders on how these activities can improve sleep quality.\n","\n","\n","**5. Targeted Marketing for Different Activity Levels**\n","\n","* Segment the audience based on their activity levels and tailor marketing messages to address their specific needs and challenges.\n","* Use data-driven insights to provide personalized recommendations and tips for users at different activity levels to help them improve their sleep and overall health.\n","\n","\n","**6. Stress-Reduction Techniques**\n","\n","* Incorporate guided stress-reduction techniques, like breathing exercises or meditation, especially for users who engage in sedentary activities. \n","    * These techniques could help improve sleep quality by addressing stress, which might be linked to both sedentary behavior and poor sleep.\n","\n","\n","**7. Community Building**\n","\n","* Foster a sense of community by creating forums or social media groups where users can share their progress and tips for maintaining an active lifestyle in relation to various health milestones.\n","* Organize community-based challenges such as team competitions, virtual events and races, monthly fitness challenges, achievement-based rewards systems, and collaborative goals.\n","* Host Q&A sessions and informative video series in collaboration with health and wellness experts, as well as nutritionists, to engage users and educate the public about women's health."]},{"cell_type":"markdown","id":"d9d4ecbf","metadata":{"papermill":{"duration":0.03897,"end_time":"2024-08-29T22:38:29.500005","exception":false,"start_time":"2024-08-29T22:38:29.461035","status":"completed"},"tags":[]},"source":["# Conclusion\n","\n","In conclusion, Bellabeat can strategically enhance its marketing approach by leveraging data-driven insights to encourage comprehensive tracking among users. By emphasizing the benefits of monitoring various women-specific health metrics, Bellabeat can empower users to make informed decisions about their health goals.\n","\n","Furthermore, highlighting the positive correlation between daily steps and calorie burn can attract fitness enthusiasts, while promoting the link between high-intensity activities and improved sleep quality can encourage healthier lifestyle choices. Tailoring marketing strategies based on different activity levels and fostering community engagement through challenges, rewards, and expert-led sessions will further strengthen Bellabeat's position in supporting women's health and wellness.\n","\n","By integrating these initiatives, Bellabeat can effectively engage users, promote healthier behaviors, and contribute to overall well-being.\n","\n","Thank you kindly for your attention and engagement in this analysis focused on women's health. Your interest in understanding these insights is greatly appreciated -- Feedback is always welcome!"]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":5614991,"sourceId":9277294,"sourceType":"datasetVersion"}],"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.4.0"},"papermill":{"default_parameters":{},"duration":27.166925,"end_time":"2024-08-29T22:38:29.66283","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-08-29T22:38:02.495905","version":"2.6.0"}},"nbformat":4,"nbformat_minor":5}